Let \[f(n) =
\begin{cases}
n^2-1 & \text{ if }n < 4,
\\ 3n-2 & \text{ if }n \geq 4.
\end{cases}
\]Find $f(f(f(2)))$.

In the diagram, $D$ and $E$ are the midpoints of $\overline{AB}$ and $\overline{BC}$ respectively. Find the sum of the slope and $y$-intercept of the line passing through the points $C$ and $D.$ [asy]
size(180); defaultpen(linewidth(.7pt)+fontsize(10pt));
pair A, B, C, D, E, F;
A=(0,6);
B=(0,0);
C=(8,0);
D=(0,3);
E=(4,0);
F=(8/3,2);
draw(E--A--C--D);
draw((-1,0)--(10,0), EndArrow);
draw((0,-1)--(0,8), EndArrow);
label("$A(0,6)$", A, W);
label("$B(0,0)$", B, SW);
label("$C(8,0)$", C, S);
label("$D$", D, W);
label("$E$", E, S);
label("$F$", F, SW);
label("$x$", (10,0), dir(0));
label("$y$", (0,8), dir(90));
[/asy]

Let \[f(x) = \left\{
\begin{array}{cl} x^2-4 & \text{ if }x < 7, \\
x-13 & \text{ if } x \geq 7.
\end{array}
\right.\] What is $f(f(f(17)))$?

Thirty identical toothpicks were used to create the figure below. There are over 25 triangles in the figure. What is the fewest number of toothpicks that could be removed so that no triangles remain?

[asy]
draw((0,0)--(8,0), linewidth(1));
draw(2dir(60)--(2dir(60)+(6,0)), linewidth(1));
draw(4dir(60)--(4dir(60)+(4,0)), linewidth(1));
draw(6dir(60)--(6dir(60)+(2,0)), linewidth(1));

draw((0,0)--8dir(60),linewidth(1));
draw((2,0)--(6dir(60)+(2,0)),linewidth(1));
draw((4,0)--(4dir(60)+(4,0)),linewidth(1));
draw((6,0)--(2dir(60)+(6,0)),linewidth(1));

draw(2dir(60)--(2,0),linewidth(1));
draw(4dir(60)--(4,0),linewidth(1));
draw(6dir(60)--(6,0),linewidth(1));
draw(8dir(60)--(8,0),linewidth(1));
[/asy]

In the diagram, triangles $ABC$ and $CBD$ are isosceles. The perimeter of $\triangle CBD$ is $19,$ the perimeter of $\triangle ABC$ is $20,$ and the length of $BD$ is $7.$ What is the length of $AB?$ [asy]

size(7cm);
defaultpen(fontsize(11));

pair b = (0, 0);
pair d = 7 * dir(-30);
pair a = 8 * dir(-140);
pair c = 6 * dir(-90);

draw(a--b--d--c--cycle);
draw(b--c);

label("$y^\circ$", a, 2 * (E + NE));
label("$y^\circ$", b, 2 * (S + SW));
label("$x^\circ$", b, 2 * (S + SE));
label("$x^\circ$", d, 2 * (2 * W));

label("$A$", a, W);
label("$B$", b, N);
label("$D$", d, E);
label("$C$", c, S);

[/asy]

Find $AX$ in the diagram if $CX$ bisects $\angle ACB$.

[asy]
import markers;

real t=.56;
pair A=(0,0);
pair B=(3,2);
pair C=(.5,1.5);
pair X=t*A+(1-t)*B;

draw(C--A--B--C--X);

label("$A$",A,SW);
label("$B$",B,E);
label("$C$",C,N);
label("$X$",X,SE);

//markangle(n=1,radius=15,A,C,X,marker(markinterval(stickframe(n=1),true)));
//markangle(n=1,radius=15,X,C,B,marker(markinterval(stickframe(n=1),true)));

label("$28$",.5*(B+X),SE);
label("$30$",.5*(B+C),N);
label("$21$",.5*(A+C),NW);

[/asy]

The surface area of a sphere with radius $r$ is $4\pi r^2$. Including the area of its circular base, what is the total surface area of a hemisphere with radius 6 cm? Express your answer in terms of $\pi$.

[asy]

import markers;
size(150);
import geometry;
draw((0,-7)--(0,-1),Arrow);
draw((10,10)--(5,5),Arrow);
label("half of sphere",(10,10),N);
label("circular base",(0,-7),S);

draw(scale(1,.2)*arc((0,0),10,0,180),dashed);
draw(scale(1,.2)*arc((0,0),10,180,360));
draw(Arc((0,0),10,0,180));

[/asy]

In the figure below, $ABCD$ is a square piece of paper 6 cm on each side. Corner $C$ is folded over so that it coincides with $E$, the midpoint of $\overline{AD}$. If $\overline{GF}$ represents the crease created by the fold such that $F$ is on $CD,$ what is the length of $\overline{FD}$? Express your answer as a common fraction. [asy]
import geometry;
size(150);
pair A = (0,0), B = (0,1), C = (1,1), D = (1,0);
path square = A--B--C--D--cycle;
draw(square);
label("A",A,SW); label("B",B,NW); label("C",C,NE); label("D",D,SE);
pair E = midpoint(A--D);
line CE = line(C,E);
pair X = midpoint(C--E); line FG = perpendicular(X,CE);

pair[] intwithsquare = intersectionpoints(FG,square);
pair G = intwithsquare[0];
pair F = intwithsquare[1];
draw(F--G,dashed);
label("F",F,E);
label("G",G,W);
[/asy]

Find the least positive four-digit solution to the following system of congruences. \begin{align*}
7x &\equiv 21 \pmod{14} \\
2x+13 &\equiv 16 \pmod{9} \\
-2x+1 &\equiv x \pmod{25} \\
\end{align*}

Find $x.$

[asy]
unitsize(0.7 cm);

pair A, B, C, D, O;

O = (0,0);
A = 4*dir(160);
B = 5*dir(160 + 180);
C = 8*dir(20);
D = 4*dir(20 + 180);

draw(A--B);
draw(C--D);
draw(A--C);
draw(B--D);

label("$4$", (A + O)/2, SW);
label("$10$", (C + O)/2, SE);
label("$4$", (D + O)/2, NW);
label("$5$", (B + O)/2, NE);
label("$8$", (B + D)/2, S);
label("$x$", (A + C)/2, N);
label("$A$", A, W);
label("$B$", B, E);
label("$C$", C, E);
label("$D$", D, W);
label("$O$", O, N);
[/asy]

In triangle $ABC,$ $D,$ $E,$ and $F$ are points on sides $\overline{BC},$ $\overline{AC},$ and $\overline{AB},$ respectively, so that $BD:DC = CE:EA = AF:FB = 1:2.$

[asy]
unitsize(0.8 cm);

pair A, B, C, D, E, F, P, Q, R;

A = (2,5);
B = (0,0);
C = (7,0);
D = interp(B,C,1/3);
E = interp(C,A,1/3);
F = interp(A,B,1/3);
P = extension(A,D,C,F);
Q = extension(A,D,B,E);
R = extension(B,E,C,F);

fill(P--Q--R--cycle,gray(0.7));
draw(A--B--C--cycle);
draw(A--D);
draw(B--E);
draw(C--F);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, S);
label("$E$", E, NE);
label("$F$", F, W);
label("$P$", P, NE);
label("$Q$", Q, NW);
label("$R$", R, S);
[/asy]

Line segments $\overline{AD},$ $\overline{BE},$ and $\overline{CF}$ intersect at $P,$ $Q,$ and $R,$ as shown above.  Compute $\frac{[PQR]}{[ABC]}.$

Two circles of radius $r$ are externally tangent to each other and internally tangent to the ellipse $x^2 + 5y^2 = 6,$ as shown below. Find $r.$
[asy]
size(7cm);
draw(scale(sqrt(6), sqrt(6)/sqrt(5))* unitcircle);
draw((0,-1.5)--(0,1.7),EndArrow);
draw((-3,0)--(3,0),EndArrow);
draw(Circle( (sqrt(0.96),0), sqrt(0.96) ));
draw(Circle( (-sqrt(0.96),0), sqrt(0.96) ));
label("$x$",(3,0),E);label("$y$",(0,1.7),N);
[/asy]
